export default class Basket extends React.Component {
    render() {
        const {cartItems} = this.props
        return(
            <div>
            {cartItems.length===0? "Basket is Empty": <div> You have {cartItems.length} items in your basket <p>cartItems.name</p></div>}

            </div>
        )
    }
}
